import Vue from 'vue'
import App from './App.vue'
import VueAxios from 'vue-axios'
import axios from './../node_modules/axios/lib/axios';



Vue.use(VueAxios,axios)
Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
